import React from "react";
import "./Title.css";
function Title() {
  return (
    <>
      <div className="title_container">
        <div className="title">
          Walchand Linux User's Group
          <br />
          <p className="presents">Presents</p>
          <div className="techno_heading">TechnoTweet 2k23</div>
        </div>
      </div>
    </>
  );
}

export default Title;
